import React, { Component } from 'react'

export class Bezitting extends Component {


    getStyle(id) {
        if(id === 1){
            return{
                background: 'red'
            }
        }else{
            return{
                background: 'blue'
            }
        }

    }
      
    
   
    render() {
        return this.props.items.map((item) => (
            <div>
                <p style = {getStyle(item.ide)}>{item.id}</p>
                <p>{item.bezitting}</p>
                <p>{item.waarde}</p>
            </div>
        ));
    }
}


export default Bezitting
